import React, {useEffect, useState} from "react";

class Cities extends React.Component {
    constructor(props) {
        super(props); 
        this.state = {
            items: [],
            DataisLoaded: false
        };
    }

    // ComponentDidMount is used to
    // execute the code 
    componentDidMount() {
        fetch(
"https://testapi.photodino.de/")
            .then((res) => res.json())
            .then((json) => {
                this.setState({
                    items: json,
                    DataisLoaded: true
                });
                console.log('bbbbbb', {items: json.locations})
            })
    }
    render() {

        const { DataisLoaded, items } = this.state;
        if (!DataisLoaded) return <div>
            <h1> Pleses wait some time.... </h1> </div> ;

        return (
        <div className = "App">
            <h1> Fetch data from an api in react </h1>  {
                items.map((item) => ( 
                <ul key = { item } >
                    <li>
                    { item.json.locations }
                    </li> 
                    </ul>
                ))
            }

        </div>
    );

}
}

export default Cities;
